INSERT INTO `master_object` VALUES ('2', 'workflow_group_details', 'WORKFLOW_GROUP_ID', null, 'SELECT defult_workflow_group_id, workflow_name FROM workflow_group ORDER BY workflow_name', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('3', 'division', null, 'Division List', 'SELECT DIVISION_ID, DIVISION_NAME FROM division ORDER BY DIVISION_NAME', null, null, null, null, null, '2', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('6', 'branch', null, 'Branch List', 'SELECT  branch.BRANCH_ID,branch.BRANCH_NAME,department.DEPARTMENT_NAME\r\n FROM branch \r\n LEFT JOIN department\r\n ON department.DEPARTMENT_ID=branch.BRANCH_ID\r\n\r\n ORDER BY BRANCH_NAME', null, null, null, null, null, '2', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('7', 'department', null, 'Department', 'SELECT  D.DEPARTMENT_ID,DEPARTMENT_NAME,DV.DIVISION_NAME\r\n FROM department AS D \r\n LEFT JOIN division AS DV\r\n ON DV.DIVISION_ID=D.DEPARTMENT_ID\r\n\r\n ORDER BY D.DEPARTMENT_NAME', null, null, null, null, null, '2', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('14', 'employee_details', 'BRANCH_ID', null, 'SELECT BRANCH_ID, BRANCH_NAME from branch ORDER BY BRANCH_NAME', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('15', 'employee_details', 'EMPLOYEE_DESIGNATION_ID', null, 'SELECT DESIGNATION_ID,DESIGNATION_NAME FROM designation ORDER BY DESIGNATION_NAME', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('16', 'employee_details', null, 'Employee Details', 'SELECT  emp.EMPLOYEE_DETAILS_ID, emp.GIVENNAME , emp.EMAIL,dv.DIVISION_NAME, dp.DEPARTMENT_NAME, br.BRANCH_NAME \r\nFROM employee_details AS emp\r\n\r\nLEFT JOIN division AS dv ON  emp.DIVISION_ID=dv.DIVISION_ID\r\nLEFT JOIN department AS dp ON emp.DEPARTMENT_ID=dp.DEPARTMENT_ID\r\nLEFT JOIN branch AS br ON emp.BRANCH_ID=br.BRANCH_ID\r\nORDER BY emp.GIVENNAME', null, null, null, null, null, '2', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('17', 'employee_details', 'GRADE', null, 'SELECT GRADE_ID,GRADE_NAME FROM grade ORDER BY GRADE_NAME', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('18', 'employee_details', 'DIVISION_ID', null, 'SELECT DIVISION_ID,DIVISION_NAME FROM division ORDER BY DIVISION_NAME', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('19', 'employee_details', 'DEPARTMENT_ID', null, 'SELECT DEPARTMENT_ID,DEPARTMENT_NAME from department ORDER BY DEPARTMENT_NAME', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('20', 'main_category', null, 'Main Category', 'SELECT main_category.MAIN_CATEGORY_ID ,main_category.MAIN_CATEGOTY_NAME,process_department.ROUTE_NAME FROM main_category \r\nLEFT JOIN Process_department ON main_category.PROCESS_DEPARTMENT_ID=process_department.REQUISITION_ROUTE_ID ORDER BY MAIN_CATEGORY_ID', null, null, null, null, null, '2', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('21', 'cost_center_code', null, '', 'SELECT cost_center_code.cost_center_code_ID,cost_center_code.COST_CODE,cost_center_code.COST_NAME,division.DIVISION_NAME\r\nFROM cost_center_code\r\nLEFT JOIN division\r\nON division.DIVISION_ID=cost_center_code.cost_center_code_ID ORDER BY COST_NAME\r\n', null, null, null, null, null, '2', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('22', 'cost_center_code', 'DIVISIONID', null, 'SELECT DIVISION_ID,DIVISION_NAME FROM division GROUP BY DIVISION_NAME', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('23', 'expense_account', null, 'Expence Account', 'SELECT EXPENSE_ACCOUNT_ID, CONCAT(ACCOUNT_NAME,\'-\',ACCOUNT_CODE) AS  ACCOUNT_NAME, mc.MAIN_CATEGOTY_NAME \r\nFROM expense_account ex\r\nLEFT JOIN main_category AS mc ON mc.MAIN_CATEGORY_ID=ex.MAIN_ACCOUNT_ID\r\nORDER BY ACCOUNT_NAME', null, null, null, null, null, '2', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('24', 'expense_account', 'MAIN_ACCOUNT_ID', null, 'SELECT MAIN_CATEGORY_ID,MAIN_CATEGOTY_NAME FROM main_category ORDER BY MAIN_CATEGOTY_NAME', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('25', 'main_category', 'PROCESS_DEPARTMENT_ID', null, 'SELECT REQUISITION_ROUTE_ID,ROUTE_NAME FROM process_department ORDER BY ROUTE_NAME', null, null, null, null, null, '1', '', '0000-00-00 00:00:00', null, null);
INSERT INTO `master_object` VALUES ('26', 'category', null, 'Category', 'SELECT category.CATEGORY_ID,category.DESCRIPTION,main_category.MAIN_CATEGOTY_NAME FROM category LEFT JOIN main_category\r\nON category.CATEGORY_ID=main_category.MAIN_CATEGORY_ID\r\n ORDER BY CATEGORY_ID', null, null, null, null, null, '2', '', '0000-00-00 00:00:00', null, null);
