INSERT INTO `requisition_approval` VALUES ('23', '19', 'ref', '2013-09-26', '<h5 class=\" print-only\">The government has decided to lay the foundation\r\n of the coal-based Rampal Thermal Power Plant in Bagherhat, near the \r\nSundarbans, on Oct 22 despite vehement and widespread opposition by \r\nenvironmental activists and other social', 'The Prime Ministerâ€™s \r\nEnergy Adviser Tawfiq-E-Elahi Chowdhury made the announcement at a press \r\nconference held at Bidyut Bhaban in the capital on Wednesday.<br><br>He said it \r\nwas not yet final whether Prime Minister Sheikh Hasina would herself lay ', 'Environmentalists, political activists, and \r\nthe local people of Bagherhatâ€™s Rampal fear the plant will endanger the very \r\nexistence of the worldâ€™s largest mangrove forest.<br><br>Members of the National \r\nCommittee on Protection of Oil, Gas, Mineral Resources, and Power-Port are \r\nheading for the plant site, barely 14km off the Sundarbans, in a Long-march in a \r\nbid to stall the project.<br><br>The government has been claiming that the \r\nenvironment would not be harmed, as there would be enough checks to prevent \r\npollution.<br><br>Regarding the opposition and widespread fear of environmental \r\nharm, Chowdhury said, â€œThe matter has to be understood with a scientific \r\noutlook, not emotion.<br><br>â€œTheir criticism is not based on information and \r\ntechnological knowledge. Our decision is based on real terms, and not emotions,â€ \r\nhe said.<br><br>Power Secretary Monowar Islam argued that coal was used to \r\nproduce 41 percent of the world\'s electricity. It accounted for 68 percent of \r\nIndia\'s power generation, while its share in Bangladesh\'s electricity production \r\nwas less than one percent.', null, null, '17', '1', 'Bangladesh singed an \r\nagreement with India in January last year to set up the 1,320MW facility named \r\nâ€˜Bangladesh-India Friendship Power Company Limitedâ€™. The neighbouring countries \r\nwill be equal partners in it.', '627', '2013-09-26', '0000-00-00', '');
INSERT INTO `requisition_approval` VALUES ('24', '21', 'City/Memo-203', '2013-09-26', 'Bangladesh singed an \r\nagreement with India in January last year to set up the 1,320MW facility named \r\nâ€˜Bangladesh-India Friendship Power Company Limitedâ€™. The neighbouring countries \r\nwill be equal partners in it.', 'Environmentalists, political activists, and \r\nthe local people of Bagherhatâ€™s Rampal fear the plant will endanger the very \r\nexistence of the worldâ€™s largest mangrove forest.<br><br>Members of the National \r\nCommittee on Protection of Oil, Gas, Minera', 'The government has been claiming that the \r\nenvironment would not be harmed, as there would be enough checks to prevent \r\npollution.<br><br>Regarding the opposition and widespread fear of environmental \r\nharm, Chowdhury said, â€œThe matter has to be understood with a scientific \r\noutlook, not emotion.<br><br>â€œTheir criticism is not based on information and \r\ntechnological knowledge. Our decision is based on real terms, and not emotions,â€ \r\nhe said.<br><br>Power Secretary Monowar Islam argued that coal was used to \r\nproduce 41 percent of the world\'s electricity. It accounted for 68 percent of \r\nIndia\'s power generation, while its share in Bangladesh\'s electricity production \r\nwas less than one percent.<br><br>The government plans to raise the daily power \r\nproduction to 24,000MW by 2021 and to 40,000MW by 2030', null, null, '0', '10', 'Your Replay............. ', '626', '2013-09-26', '0000-00-00', '');
